import Layout from "../components/Layout";

const About = () => {
  return (
    <Layout>
      <h1>About Us</h1>
      <ul className="company-info">
        <li>
          <span className="company">Fi Studio Inc</span>
        </li>
      </ul>
    </Layout>
  );
};

export default About;
